class Dashboard extends React.Component {

   state = {
      today_total_gross_income: NaN,
      today_total_receivable: NaN,
      all_total_gross_income: NaN,
      all_total_receivable: NaN,
      loading: true
   };

   componentDidMount() {
      axios.get('/api/dashboard/incomereceivable')
      .then((response) => {
         if(response.status === 200) {
            this.setState(response.data);
            setTimeout(() => {
              this.setState({loading: false}); 
            }, 300);
         }
      })
      .catch((err) => {
         console.log(err);
      });
   }

   render() {

      if(this.state.loading)
         return (
            <Content style={{background: '#FFF',margin: '24px 24px 24px 36px', padding: 21}}>
               <Skeleton loading={this.state.loading} paragraph={{rows: 14}} active />
            </Content>
         );

      return (
         <Content style={{margin: '24px 24px 24px 36px'}}>
            <Row gutter={24} style={{marginBottom: 24}}>
               <Col span={6}>
                  <Card bordered={false}>
                     <Text type="secondary">Today's Total Gross Income</Text>
                     <Title style={{fontWeight: 'normal', margin: 0}} level={2}><Icon component={TealPHP} /> {this.state.today_total_gross_income.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")}</Title>
                  </Card>
               </Col>
               <Col span={6}>
                  <Card bordered={false}>
                     <Text type="secondary">Today's Total Receivable</Text>
                     <Title style={{fontWeight: 'normal', margin: 0}} level={2}><Icon component={OrangePHP} /> {this.state.today_total_receivable.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")}</Title>
                  </Card>
               </Col>
               <Col span={6}>
                  <Card bordered={false}>
                     <Text type="secondary">Total Gross Income</Text>
                     <Title style={{fontWeight: 'normal', margin: 0}} level={2}><Icon component={TealPHP} /> {this.state.all_total_gross_income.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")}</Title>
                  </Card>
               </Col>
               <Col span={6}>
                  <Card bordered={false}>
                     <Text type="secondary">Total Receivable</Text>
                     <Title style={{fontWeight: 'normal', margin: 0}} level={2}><Icon component={OrangePHP} /> {this.state.all_total_receivable.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")}</Title>
                  </Card>
               </Col>
            </Row>
           
            <Row>
               <Col style={{backgroundColor: "#fff"}} span={24}>
                  <Tabs defaultActiveKey="1">
                     <TabPane tab={<Text style={{fontSize: 18}}><Icon type="bar-chart" /> Visits</Text>} key="1">
                        <VisitChart />
                     </TabPane>
                     <TabPane tab={<Text style={{fontSize: 18}}><Icon type="line-chart" /> Finances</Text>} key="2">Content of Tab Pane 2</TabPane>
                  </Tabs>
               </Col>
            </Row>

         </Content>
      );
   }
}


export default Dashboard;